import React, {useState} from 'react';
import ReactDOM from 'react-dom';
import './index.css'
import contact from './contacts'
import Xam from './Xam'
import * as cal from './Heading'
import {  BrowserRouter as Router,Route, Routes, Link} from 'react-router-dom'

function createCard(contact) {
  if (contact.theloai == "giải đố" || contact.theloai == "thể thao")
  return (
    <cal.default 
    id = {contact.id}
    image = {contact.image}
    name = {contact.name}
    ngayph = {contact.ngayph}
    theloai = {contact.theloai}
    solike = {contact.solike}
    sodislike = {contact.sodislike}
    socmt = {contact.socmt}
     />
  )
}
function zzz() {
  return (
  <div className = "cacgame">
  {contact.map(createCard)}
</div>
  )
}

function App() {
  const [items, setItems] = useState([]);
  return (
  <Router>
      {zzz}
      <Routes> 
       <Route exact path = "/Xam" element = {<Xam />} />
       <Route exact path = "/Xam" element = {<Xam />} />
       <Route exact path = "/Xam" element = {<Xam />} />
      </Routes>
      
  </Router>
  )
 }

export default App;
